import React, { useEffect, useState } from 'react';
import api from '../services/api';
import './AdminPanel.css';

function AdminPanel() {
    const [users, setUsers] = useState([]);
    const [courses, setCourses] = useState([]);
    const [articles, setArticles] = useState([]);
    const [subscriptions, setSubscriptions] = useState([]);
    const [subscriptionTypes, setSubscriptionTypes] = useState([]);

    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    const [newUser, setNewUser] = useState({ name: '', email: '', password: '', is_active: true });
    const [newCourse, setNewCourse] = useState({
        title: '',
        description: '',
        price: '',
        is_active: false,
        is_subscription_based: false,
    });
    const [newArticle, setNewArticle] = useState({ title: '', content: '', course_id: '' });
    const [newSubscription, setNewSubscription] = useState({
        user_id: '',
        subscription_type_id: '',
        start_date: '',
        end_date: '',
        status: 'Active',
    });
    const [newSubscriptionType, setNewSubscriptionType] = useState({
        name: '',
        description: '',
        price: '',
        is_active: true,
    });

    useEffect(() => {
        const fetchData = async () => {
            try {
                const [
                    usersRes,
                    coursesRes,
                    articlesRes,
                    subscriptionsRes,
                    subscriptionTypesRes,
                ] = await Promise.all([
                    api.get('/usercus'),
                    api.get('/courses'),
                    api.get('/articles'),
                    api.get('/subscriptions'),
                    api.get('/subscription-types'),
                ]);
                setUsers(usersRes.data);
                setCourses(coursesRes.data);
                setArticles(articlesRes.data);
                setSubscriptions(subscriptionsRes.data);
                setSubscriptionTypes(subscriptionTypesRes.data);
            } catch (err) {
                setError('Failed to load admin data');
            } finally {
                setLoading(false);
            }
        };

        fetchData();
    }, []);

    const createHandler = async (endpoint, data, setState, resetState) => {
        try {
            const response = await api.post(endpoint, data);
            setState((prev) => [...prev, response.data]);
            resetState();
        } catch (err) {
            alert(`Failed to create ${endpoint}`);
        }
    };

    const deleteHandler = async (endpoint, id, setState) => {
        try {
            await api.delete(`${endpoint}/${id}`);
            setState((prev) => prev.filter((item) => item.id !== id));
        } catch (err) {
            alert(`Failed to delete ${endpoint}`);
        }
    };

    if (loading) return <div className="admin-loading">Loading admin panel...</div>;
    if (error) return <div className="admin-error">Error: {error}</div>;

    return (
        <div className="admin-panel">
            <h1 className="admin-title">Admin Panel</h1>

            <section className="admin-section">
                <h2>Users</h2>
                <form
                    onSubmit={(e) => {
                        e.preventDefault();
                        createHandler('/usercus', newUser, setUsers, () =>
                            setNewUser({ name: '', email: '', password: '', is_active: true })
                        );
                    }}
                    className="admin-form"
                >
                    <input
                        type="text"
                        placeholder="Name"
                        value={newUser.name}
                        onChange={(e) => setNewUser({ ...newUser, name: e.target.value })}
                        required
                    />
                    <input
                        type="email"
                        placeholder="Email"
                        value={newUser.email}
                        onChange={(e) => setNewUser({ ...newUser, email: e.target.value })}
                        required
                    />
                    <input
                        type="password"
                        placeholder="Password"
                        value={newUser.password}
                        onChange={(e) => setNewUser({ ...newUser, password: e.target.value })}
                        required
                    />
                    <label>
                        Active
                        <input
                            type="checkbox"
                            checked={newUser.is_active}
                            onChange={(e) =>
                                setNewUser({ ...newUser, is_active: e.target.checked })
                            }
                        />
                    </label>
                    <button type="submit" className="admin-button">Add User</button>
                </form>
                <ul className="admin-list">
                    {users.map((user) => (
                        <li key={user.id}>
                            {user.name} - {user.email}
                            <button
                                onClick={() => deleteHandler('/usercus', user.id, setUsers)}
                                className="admin-delete-button"
                            >
                                Delete
                            </button>
                        </li>
                    ))}
                </ul>
            </section>

            {/* Add other sections here with the same structure */}
        </div>
    );
}

export default AdminPanel;
